import React, { Component } from "react";
import "./estilos.css";
import 'bootstrap/dist/css/bootstrap.min.css';

class NumeroDeCartas extends Component{
    constructor(props){
        super(props)
    }

   render(){
       return(
           <section>
               <form>
                   <input name='num' type='radio' value='5'/>
                   <input name='num' type='radio' value='10'/>
                   <input name='num' type='radio' value='15'/>
                   <input name='num' type='radio' value='20'/>
                    <label for='quaisCartas'>Escolher:</label>
                   <select id='quaisCartas'>
                        <opition value="aleatoria">Aleatoriamente</opition>
                       <opition value='melhores'>Melhores cartas</opition>
                       <opition value='piores'>Piores cartas</opition>
                   </select>
                   <button id='enviarFormulario'>Enviar</button>
               </form>
           </section>

       )
   }
}

export default NumeroDeCartas;
